import React from 'react';
import MyNavbar from '../components/MyNavbar';
import Product from '../components/Product';
import ProductsData from '../ProductsData';

const HomeView = () => {
    return (
        <div>
            <MyNavbar />
            <Product 
                pic={ProductsData.data.tommy.image} 
                name={ProductsData.data.tommy.name} 
                id={ProductsData.data.tommy.id}
                description={ProductsData.data.tommy.description}
            />
            <Product 
                pic={ProductsData.data.wicho.image} 
                name={ProductsData.data.wicho.name} 
                id={ProductsData.data.wicho.id}
                description={ProductsData.data.wicho.description}
            />
        </div>
    );
}
 
export default HomeView;
